(window.webpackJsonp=window.webpackJsonp||[]).push([[701],{1056:function(n,h,t){"use strict";t.r(h);var i=t(44),g=Object(i.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1605-ta-muon-đi-lac-gia"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1605-ta-muon-đi-lac-gia"}},[n._v("#")]),n._v(" Chương 1605: Ta muốn đi Lạc gia")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 1605: Ta muốn đi Lạc gia"),t("br"),t("br"),n._v("“Cái này còn tạm được!” Trương Huyền thoả mãn nhẹ gật đầu, đưa tay đem phù lục nắm tại đầu ngón tay."),t("br"),t("br"),n._v("Đối phương nếu là Khổng sư huyết dịch luyện chế mà thành, như vậy hắn thân là trời nhận danh sư, tự nhiên cũng có thể để hắn thần phục, thử một lần phía dưới, quả nhiên."),t("br"),t("br"),n._v("“...”"),t("br"),t("br"),n._v("Ngột Thần con mắt trợn tròn."),t("br"),t("br"),n._v("Nói thật, hắn thật sự là thấy qua việc đời, hơn nữa, kiến thức rộng rãi, nhưng hôm nay nhận xung kích, so cả một đời tới đều nhiều, không phục đều không được."),t("br"),t("br"),n._v("Khổng sư luyện chế phù lục, liền Khưu Ngô Cổ Thánh, Nhiễm Cầu Cổ Thánh đều không để vào mắt, bị sờ soạng thoáng cái, liền thuận lợi thần phục... Ngươi còn có cái gì không làm được sao?"),t("br"),t("br"),n._v("Bất quá, để hắn chân chính kinh ngạc cũng không phải là như vậy, mà là, nắm lại phù lục về sau, Trương Huyền bàn tay run lên, người này người tranh đoạt, dính dáng Khổng sư trọng yếu nhất bảo tàng bảo vật, liền nhẹ nhàng rơi vào Lạc Nhược Hi lòng bàn tay."),t("br"),t("br"),n._v("“Nhược Hi, trương này thiên phù, ngươi cầm trước đi! Dù sao ở lại trong tay của ta cũng vô dụng.”"),t("br"),t("br"),n._v("“...”"),t("br"),t("br"),n._v("Ngột Thần thân thể cứng ngắc."),t("br"),t("br"),n._v("Phía trước bốn người dùng hết đủ loại bảo vật, đều phải cướp đi thứ này, đủ thấy trân quý, tiện tay đưa người, mảy may đều không để ý..."),t("br"),t("br"),n._v("Bất quá, kinh ngạc hơn còn tại đằng sau."),t("br"),t("br"),n._v("“Tờ phù lục này đã nhận ngươi làm chủ nhân, thả ngươi nơi đó là được! Ta giữ lại càng vô dụng... Chỉ cần đến lúc đó Khổng miếu mở ra, ngươi dẫn ta đi vào là được!” Lắc đầu, Lạc Nhược Hi đồng dạng một mặt không quan tâm, đem phù lục lần nữa đưa tới."),t("br"),t("br"),n._v("“Cũng được!” Chần chờ một chút, Trương Huyền một mặt bất đắc dĩ lần nữa đem phù lục tiếp lấy."),t("br"),t("br"),n._v("Xuân Thu đại điển nói rất lợi hại, nhưng có Thiên đạo thư viện, hắn thấy, có cũng được mà không có cũng không sao, chớ nói chi là một tấm bùa chú."),t("br"),t("br"),n._v("Lần này tới, chủ yếu là bởi vì nữ hài mời, cũng muốn cùng đối phương chờ lâu một đoạn thời gian, thuận tiện biết rõ ràng, nàng cụ thể thân phận... Hiện tại biết nàng sẽ không làm thật xin lỗi nhân tộc sự tình, phù lục đưa xong, cũng không có gì."),t("br"),t("br"),n._v("Chỉ là... Không nghĩ tới đối phương cũng không quá quan tâm."),t("br"),t("br"),n._v("Bên này nhún nhường, làm người trong cuộc truyền thế thiên phù sắp khóc."),t("br"),t("br"),n._v("Đường đường Khổng sư luyện chế bảo vật, Nhiễm Cầu Cổ Thánh cũng không có tư cách luyện hóa đồ vật, như vậy không có tôn nghiêm bị người đẩy tới đẩy lui, liền cầm đều không muốn cầm... Đừng kéo ta, để cho ta đập đầu chết..."),t("br"),t("br"),n._v("Được rồi, ta chỉ là một cái phù lục, một trang giấy, không có đầu, muốn đụng cũng đụng không chết..."),t("br"),t("br"),n._v("Đang lòng tràn đầy buồn bực, chỉ thấy mới vừa biết chủ nhân, một mặt trông mong nhìn qua, một bộ thần giữ của bộ dáng."),t("br"),t("br"),n._v("“Tiểu Phù Phù, nếu ngươi đã nhận chủ, chỗ này di tích nhưng còn có bảo vật? Một khối sưu tập tới, để cho ta mang đi đi!”"),t("br"),t("br"),n._v("“...” Phù lục uốn éo người: “Không còn...”"),t("br"),t("br"),n._v("“Làm sao lại không còn? Không phải có chín mươi chín cái lối đi ư? Đã ta cái lối đi kia bên trong có long cốt thần thương, cái khác trong thông đạo, khẳng định cũng có bảo vật đi...” Trương Huyền nghi ngờ."),t("br"),t("br"),n._v("“Cái khác thông đạo, tất cả đều là khảo hạch, hoặc là sát trận, không có bảo vật...”"),t("br"),t("br"),n._v("Phù lục lay động."),t("br"),t("br"),n._v("“Không có?” Trương Huyền nghi ngờ nhìn về phía Lạc Nhược Hi hai người, chỉ thấy bọn họ nhẹ gật đầu: “Nó nói không sai, chúng ta đi qua thông đạo, là một loại khảo hạch, cũng không phát hiện bảo vật...”"),t("br"),t("br"),n._v("“Như vậy ah...” Trương Huyền một hồi thất lạc."),t("br"),t("br"),n._v("Vốn đang cho rằng chín mươi chín cái lối đi, mỗi một cái đều có có thể so với long cốt thần thương bảo vật, hiện tại xem ra, suy nghĩ nhiều..."),t("br"),t("br"),n._v("“Đúng rồi, ngươi đem cửa phía ngoài ‘Nhiễm Tử điện’ ba chữ cho ta gảy xuống đây đi, đây cũng là đồ tốt!”"),t("br"),t("br"),n._v("Rơi vào đường cùng, Trương Huyền lùi lại mà cầu việc khác."),t("br"),t("br"),n._v("“...” Phù lục."),t("br"),t("br"),n._v("Gặp qua gảy, chưa thấy qua như thế gảy... Đây chính là Nhiễm Cầu Cổ Thánh thân bút lưu lại bảng hiệu, liền lời không buông tha..."),t("br"),t("br"),n._v("Người khác chiến đấu, ném ra trường kiếm, trường thương... Ngươi ném ra một khối biển..."),t("br"),n._v(" ..."),t("br"),t("br"),n._v("Không để ý tới sắp khóc phù lục, đem Nhiễm Tử điện triệt để cướp sạch không còn, Trương Huyền lúc này mới thoả mãn đi trở về."),t("br"),t("br"),n._v("Không quản lý việc nhà không biết củi gạo quý, thật vất vả tới ăn một cái nhà giàu, đương nhiên muốn ăn mỡ toàn ruột mập."),t("br"),t("br"),n._v("“Mang bọn ta rời đi đi!”"),t("br"),t("br"),n._v("Dặn dò phù lục một tiếng, người sau thân thể một hồi vặn vẹo, mọi người lập tức bị ánh sáng bao phủ, sau một khắc, đã xuất hiện tại không gian gấp bên ngoài, lần nữa trở lại Bạch Khê sơn."),t("br"),t("br"),n._v("“Tiểu thư, Trương sư, ta có một số việc cần lập tức xử lý, khả năng xin từ biệt... Chờ ta xử lý xong, lại tới tìm các ngươi!”"),t("br"),t("br"),n._v("Mới vừa ổn định thân hình, Ngột Thần liền ôm quyền khom người, trên mặt lộ ra một tia lo âu và lo lắng."),t("br"),t("br"),n._v("“Chuyện gì xảy ra? Có cần hay không giúp một tay?” Trương Huyền nhìn qua."),t("br"),t("br"),n._v("“Một chút việc nhỏ mà thôi, làm phiền Trương sư quải niệm, một mình ta liền có thể xử lý!” Ngột Thần gật đầu."),t("br"),t("br"),n._v("“Vậy là tốt rồi...” Trương Huyền thở phào nhẹ nhõm."),t("br"),t("br"),n._v("“Ừm, đi đi, giúp xong, liên hệ ta là được!” Lạc Nhược Hi nhẹ gật đầu."),t("br"),t("br"),n._v("“Đa tạ!” Ngột Thần không nói thêm lời, ngón tay một điểm, trước mắt xuất hiện lần nữa không gian thông đạo, thân thể vụt qua, trực tiếp nhảy vào, chỉ chốc lát liền biến mất ở hai người trước mặt."),t("br"),t("br"),n._v("Thấy hắn rời đi, Trương Huyền nhìn về phía cách đó không xa nữ hài, mỉm cười: “Nhược Hi, ngươi tiếp xuống có tính toán gì?”"),t("br"),t("br"),n._v("Truyền thế mẫu phù tới tay, còn lại phù lục, cho dù không tìm, cũng không sao, không có cái gì, hiện tại muốn làm, chính là chờ đợi Khổng miếu mở ra, trực tiếp đi vào là đủ."),t("br"),t("br"),n._v("“Ta tạm thời không có việc gì...” Lạc Nhược Hi lắc đầu."),t("br"),t("br"),n._v("“Không có việc gì, không bằng cùng ta cùng một chỗ về Trương gia! Trước đó đi vội vàng, lần này vừa vặn dẫn ngươi gặp thấy cha mẹ!” Trương Huyền mỉm cười."),t("br"),t("br"),n._v("Xa cách từ lâu gặp lại, đương nhiên không hy vọng sớm như vậy liền tách ra."),t("br"),t("br"),n._v("Bản thân mới vừa về đến gia tộc, nhận cha mẹ, như là đã xác định quan hệ, cũng muốn mang nàng đi gặp."),t("br"),t("br"),n._v("“Cái này...”"),t("br"),t("br"),n._v("Lạc Nhược Hi trắng toát trên mặt hơi đỏ lên: “Ta tại Lạc gia đại náo, đưa ngươi mang đi, làm cho Trương gia cùng Lạc gia xuất hiện mâu thuẫn... Cứ như thế trôi qua, không tốt lắm đâu!”"),t("br"),t("br"),n._v("“Có cái gì tốt không tốt, bọn họ rất dễ nói chuyện...”"),t("br"),t("br"),n._v("Trương Huyền mỉm cười."),t("br"),t("br"),n._v("Tuy là cái này cha mẹ tới bất ngờ, hắn đến bây giờ cũng không có la đi ra, nhưng không thể không thừa nhận, đối phương đối với hắn vô cùng cưng chiều."),t("br"),t("br"),n._v("Không nói cái khác, liền nói lúc ấy tại Lạc gia, huyên náo như thế cương, càng quan hệ Trương, Lạc hai đại gia tộc mặt mũi, đổi lại cái khác cha mẹ, sớm đã đem chính mình cái này bất hiếu gia hỏa một bàn tay đập chết, đối phương vậy mà toàn lực ủng hộ, chỉ bằng vào điểm ấy, đáng giá được tôn kính."),t("br"),t("br"),n._v("“Cái này...”"),t("br"),t("br"),n._v("Mặt mũi xoắn xuýt, Lạc Nhược Hi không biết nên làm sao bây giờ, có chút chân tay luống cuống."),t("br"),t("br"),n._v("Đối với bất cứ chuyện gì, nàng đều có thể lạnh lùng như băng, lạnh nhạt như nước, thậm chí truyền thế mẫu phù, đặt ở Trương Huyền trong tay, vẫn là trong tay nàng, cũng không đáng kể, nhưng... Cái này, có chút không để cho nàng biết như thế nào cho phải."),t("br"),t("br"),n._v("“Không cần khẩn trương, sớm muộn đều phải thấy, đi gặp, cũng chờ tại xác lập hai người chúng ta quan hệ!”"),t("br"),t("br"),n._v("Biết lo lắng của nàng, Trương Huyền nắm chặt bàn tay của đối phương: “Tốt, cứ như vậy định, đừng từ chối!”"),t("br"),t("br"),n._v("“Ta...” Thấy đối phương trong mắt mang theo khát vọng, Lạc Nhược Hi dừng lại một chút, cuối cùng không có cự tuyệt: “Tốt a!”"),t("br"),t("br"),n._v("“Ừm!” Gặp nàng đồng ý, Trương Huyền mỉm cười, đột nhiên nhớ tới cái gì: “Bất quá, trở về trước đó, ta nghĩ trước đi một chuyến Lạc gia!”"),t("br"),t("br"),n._v("“Đi Lạc gia?” Lạc Nhược Hi cau mày."),t("br"),t("br"),n._v("(Thứ hai, cầu nguyệt phiếu cùng phiếu đề cử! Có, đừng quên đầu cho lão nhai a, cám ơn!)"),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1616"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1618"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);